/* Geral */
#header,.top-bar,.footer {
    background: #000;
    background-color: #000;
    color: #fff;
}


#header a,.top-bar a,.footer  a {
    color: #fff;
}

.menu__social .fab,
.footer__social .fab{
    color: #FFF;
}


/* Menu lateral */
#menu .menu__item {
    color: #FFF;
}


/* Footer */

.footer__stamps li {
    margin: 2px 0;
    padding: 2px 0px;
}

.footer__stamps img {
    width: auto !important;
    max-height: 43px !important;
    background: #FFF;
}
